module.exports = a = async ({ params }) => {
  const appName = (params.appName || "").toLowerCase();

  // List of supported verticals
  const verticals = [
    "airlines", "company", "eats", "education", "finance", "generic",
    "government", "health", "hotels", "insurance", "manufacturing",
    "pharmacy", "realty", "retail", "sports"
  ];

  // Find matching vertical or fallback to "generic"
  const matchedVertical = verticals.find(v => appName.includes(v)) || "generic";

  // Extract potential theme name (e.g., 'verdepersona' from 'verdepersona_manufacturing')
  const themeKey = appName
    .replace(/[^a-z0-9_ ]/gi, "") // sanitize
    .split(/[\s_]/)[0] // take the first word
    .toLowerCase();

  // Theme resolution logic
  function getThemeConfig() {
    const themes = params.themeObject || null;
    const themeId = params.themeId || null;

    if (!themes || themes.length === 0) return null;

    let selectedTheme = null;

    // Try finding by themeKey (matches config.name includes themeKey)
    selectedTheme = themes.find(theme =>
      theme.configuration?.name?.toLowerCase().includes(themeKey)
    );

    // Fallback to themeId
    if (!selectedTheme && themeId) {
      selectedTheme = themes.find(theme => theme.id === themeId);
    }

    // Fallback to default
    if (!selectedTheme) {
      selectedTheme = themes.find(theme => theme.default === true);
    }

    if (selectedTheme && selectedTheme.configuration) {
      return {
        id: selectedTheme.id,
        ...selectedTheme.configuration
      };
    }

    return null;
  }

  const themeObject = getThemeConfig();

  return {
    dynamicVariables: dashboardJson.dashboards[matchedVertical],
    fullVariable: dashboardJson,
    themeObject: themeObject
  };
};

